  { id: 1, name: "ATLANTIS", color: "bg-blue-100 text-blue-800" },
  { id: 2, name: "IBIZA", color: "bg-purple-100 text-purple-800" },
  { id: 3, name: "BLESS", color: "bg-green-100 text-green-800" }
];

export default locations;
